;
; pad1_zapper = zap_shoot(0);   // controller slot 2
;
	lda     #$00
	jsr     _zap_shoot
	sta     _pad1_zapper
;
; trigger_pulled = (pad1 & PAD_B) || (pad1 & PAD_A) || zap_shoot(0);                // controller slot 1 zapper
;
	lda     _pad1
	and     #$40
	bne     LDA1E
	lda     _pad1
	and     #$80
	bne     LDA1E
	jsr     _zap_shoot
